import React from "react";
import { Tile } from "../tile/Tile";



export const TileList = (props) => {
  const { contactArray } = props;

  return (
    <div>
      {contactArray.map((contact, index)=> {
          
          const {name, ...rest} = contact;
          <div>
          <Tile name={name} description={rest} />
          </div>
      }
      )}
      
    </div>
  );
};
